from colorama import Style, Fore
brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
brightyellow = "\001" + Style.BRIGHT + Fore.YELLOW + "\002"
reset = Style.RESET_ALL

@register("cacls")
class CaclsBof(Bof):
	base64bof: str = ""
	x86base64bof: str = ""

	def help_menu():
		menu = """
Lists file permissions (Wildcards are supported)
cacls <file path> 

Usage:
	cacls C:\\windows\\system32\\*
	cacls C:\\windows\\system32\\cmd.exe

Key:
	F: Full access
	R: Read & Execute access
	C: Read, Write, Execute, Delete
	W: Write access"
"""
		print(brightgreen + menu + reset)
		return

	@staticmethod
	def check_args(zargs: List[str] | None, Zargs: List[str] | None, int16: List[int] | None = None, int32: List[int] | None = None) -> list[str]:
		Zargs = Zargs or []
		extra: List[str] = []
		if len(Zargs) < 2:
			extra.append(f"{Zargs[0]}")
		return extra
